import { useState } from 'react';
import { PersonalInfosStep } from './step/PersonalInfos/PersonalInfos';
import styles from './styles.module.scss';

export default function RegisterScreen() {
  const [formValues, setFormValues] = useState<PersonalInfosInterface>({
    nome: '',
    email: '',
    username: '',
    senha: '',
    confirmação: '',
    logradouro: '',
    número: '',
    bairro: '',
    localidade: '',
    estado: '',
    cep: '',
    complemento: '',
  });
  return (
    <section className={styles.form__container}>
      <div className={styles.form__container__center}>
        <h1>Cadastre-se</h1>
        <PersonalInfosStep values={formValues} setValues={setFormValues} />
      </div>
    </section>
  );
}
